import React from "react";
import avatar from "../assets/ayoub.jpeg";
import "../assets/NavBar.css";
function NavBar() {
	return (
		<nav className="nav">
			<h3 className="nav__title">
				ToDo <span>List</span>
			</h3>

			<ul className="nav__list">
				<li>
					<a>item1</a>
				</li>
				<li>
					<a>item2</a>
				</li>
				<li>
					<a>item3</a>
				</li>
				<li>
					<a>item4</a>
				</li>
			</ul>
			<img src={avatar} width="40px" />
		</nav>
	);
}

export default NavBar;
